import { Link } from "react-router-dom"
import "./style.css"
const Home = ({members}) => {


    return(
        <div className="pricipal">
        {
            members.map((e) => {return e.type === "pj" ? <Link to={`/company/${e.id}`}>{e.name}</Link> : <Link to={`/customer/${e.id}`}>{e.name}</Link> })
        }
        </div>
    )
}

export default Home
